import './App.css';
import Page2 from './Page2';
import { BrowserRouter as Route } from 'react-router-dom';
import Login from './LogIn/Login';
function App() {
  return (
    <div className="App">
      <div className="AppGlass">
        <Route exact path="/" component={Login} />
        <Route exact path="/Page2" component={Page2} />
      </div>
    </div>
  );
}

export default App;
